    <>
    <Router>
        <Navbar/>
        <Routes>
          <Route path='/' element={<Home/>} />
          <Route path='/services' element={<Service/>} />
          <Route path='/about' element={<About/>} />
        </Routes>
        <Footer/>
      </Router>
    </>
  );
}

export default App;
